import '../NewsText.scss';
import Title from '../../../../../../components/TitleofSection/Title';

export const FraudCases = () => {
  return (
    <section id="newstext">
      <div className="myContainer">
        <div className="title">
          <Title value="FIRILDAQÇILIQ HALLARININ QARŞISINI ALMAQ ÜÇÜN" isWhite={false} />
        </div>
        <div className="news-content">
          <p>
            Əziz müştərilərimiz, bağlamaların təhlükəsiz təhvil verilməsini təşkil etməyimiz üçün sizin
            köməyinizə ehtiyyacımız var. Sizin köməyiniz nədən ibarətdir? Bağlamalarınızı təhvil almağa
            gələrkən vəsiqənizin əslini özünüzlə gətirin. Başqa birinin sizin bağlamanızı təhvil almasını
            istəyirsinizsə, siz ona mütləq etibarnamə verməlisiniz. Etibarnamə sizi qorxutmasın. Bu notarial
            qaydada verilən etibarnamə deyil. Etibarnamə vermək üçün sadəcə glob.az hesabınıza daxil olaraq
            ETİBARNAMƏ bölməsinə klik edin. Əlavə et butonuna keçid edib, təhvil alacaq şəxsin vəsiqə
            məlumatlarını yazın. Əlavə olaraq bildirmək istəyərdik ki, telefon vasitəsi ilə vəsiqə şəklini
            göstərib bağlama təhvil ala bilməyəcəksiniz. Bu məhdudiyyətlər işi çətinləşdirmək üçün yox,
            təhlükəsiz təhvil verilməni təşkil etmək üçündür. Anlayışınız üçün təşəkkür edirik.
          </p>
        </div>
      </div>
    </section>
  );
};
